import React, { Component } from 'react';

class AddBidComponent extends Component {

    constructor(props){
        super(props)

        this.state ={
            bidAmt:''
        }
    }
    render() {
        return (
            <div>
                <h2>In add bid component</h2>
                
            </div>
        );
    }
}

export default AddBidComponent;
